const [post, setPost] = React.useState([]);

React.useEffect(() => {

axios.get("/getImagesArray").then(response => {
  setPost(response.data.imagesArray);
})
})

return (post.map(item => {
        return <div key={item.id}>
          <img src={item} alt="images" />
          </div>
        })
      );
}

